import React from 'react';
import './style.css';

const architectPlan = () => {
  return (
    <>
      <main className="col-sm-12 col-md-12 col-lg-12 col-xl-12 main text-center p-5">
        <img
          src={Underprocess}
          className="img-fluid under-process"
          alt=""
        />
      </main>
    </>
  )
}

export default architectPlan;
